    <script>
        window.addEventListener('load', function () {
            setTimeout(function () {
                document.querySelector('.splash-screen').style.display = 'none';
                document.querySelector('body').style.overflowY = 'scroll';
                document.getElementById('main-content').style.display = 'block';
            }, 2000); // Adjust the delay (in milliseconds) as desired
        });

        const topNav = document.querySelector("nav#topNav");
        const bottomNav = document.querySelector("nav#bottomNav");

      
        window.addEventListener("scroll", function () {
            const headerRect = topNav.getBoundingClientRect();

            if (headerRect.bottom <= 0) {
                topNav.classList.add("hide");
                bottomNav.classList.add("show");
            } else {
                topNav.classList.remove("hide");
                bottomNav.classList.remove("show");
            }

           
        });

        const homeLink = document.getElementById('homeLink');
        const aboutLink = document.getElementById('aboutLink');
        const workLink = document.getElementById('workLink');
        const contactLink = document.getElementById('contactLink');

const homeSection = document.getElementById('top');
const workSection = document.getElementById('work');
const aboutSection = document.getElementById('about');
const contactSection = document.getElementById('contact');

const observer = new IntersectionObserver(entries => {
    entries.forEach(entry => {
        if (entry.target === homeSection && entry.isIntersecting) {
            homeLink.classList.add("active");
        } else {
            homeLink.classList.remove("active");
        }


        if (entry.target === aboutSection && entry.isIntersecting) {
            aboutLink.classList.add("active");
        } else {
            aboutLink.classList.remove("active");
        }

        if (entry.target === workSection && entry.isIntersecting) {
            workLink.classList.add("active");
        } else {
            workLink.classList.remove("active");
        }

        if (entry.target === contactSection && entry.isIntersecting) {
            contactLink.classList.add("active");
        } else {
            contactLink.classList.remove("active");
        }
    });
});


// Start observing Section 2
observer.observe(homeSection);
observer.observe(workSection);
observer.observe(aboutSection);
observer.observe(contactSection);
    </script>
